const t=document.getElementById("check-wbhook"),e=document.getElementById("status-display");t.addEventListener("click",(()=>{(async function(){const t=await fetch("/testpoint.php");if(t.status>299)throw new Error(`Recieved error code: ${t.status}`);const e=t.headers.get("Content-Type");if(!e?.startsWith("application/json"))throw new Error(`Expected 'application/json' content type, got ${e}`);return t.json()})().then((t=>{const o=t.code<300?"Good":"Error: "+t.text;e.textContent=`HTTP ${t.code}: ${o}`}))}));for(const t of document.getElementsByClassName("collapsible")){const e=t.parentElement.querySelector("button.collapse-button");e.addEventListener("click",(()=>{t.classList.contains("collapsed")?(t.classList.remove("collapsed"),e.textContent="Collapse scores"):(t.classList.add("collapsed"),e.textContent="Expand scores")}))}export{};